import React from "react";
import classes from "./menus.module.scss";
import AngleDown from "../../trifles/icons/AngleDown";

const Menus = ({categories}) => {

  return (
    <div className={classes.menus}>
      {categories.map((item) => (
        <span className={classes.point} key={Date.now() + Math.random()}>
          {item}
          <AngleDown />
        </span>
      ))}
    </div>
  );
};

export default Menus;
